// SPDX-License-Identifier: GPL-3.0+
pragma solidity ^0.8.0;

import "./ERC20Mintable.sol";

contract ERC20Factory {
    address[] public tokens;
    mapping(string => address) deployedAddress;

    function createToken(string calldata _name, string calldata _symbol) external {
        require(deployedAddress[_name] == address(0), "ERC20Factory: TOKEN ALREADY EXISTS");

        ERC20Mintable token = new ERC20Mintable(_name, _symbol);
        address tokenAddress = address(token);
        tokens.push(tokenAddress);
        deployedAddress[_symbol] = tokenAddress;
    }

    function getTokens() external view returns (address[] memory) {
        return tokens;
    }

    function getAddressForSymbol(string calldata _symbol) external view returns (address) {
        return deployedAddress[_symbol];
    }
}
